import React, { useState } from 'react';
import {
  Container,
  Paper,
  Table,
  TableBody,
  TableCell,
  TableContainer,
  TableHead,
  TableRow,
  Button,
  TextField,
  Box,
  Typography,
} from '@mui/material';
import DeleteIcon from '@mui/icons-material/Delete';
import EditIcon from '@mui/icons-material/Edit';

interface Result {
  id: number;
  courseUnit: string;
  creditUnit: number;
  gpa: number;
}

const Results = () => {
  const [results, setResults] = useState<Result[]>([
    { id: 1, courseUnit: 'Mathematics', creditUnit: 3, gpa: 3.5 },
    { id: 2, courseUnit: 'Physics', creditUnit: 4, gpa: 3.8 },
  ]);
  const [editingId, setEditingId] = useState<number | null>(null);
  const [newResult, setNewResult] = useState<Omit<Result, 'id'>>({
    courseUnit: '',
    creditUnit: 0,
    gpa: 0,
  });

  const handleAdd = () => {
    if (newResult.courseUnit && newResult.creditUnit && newResult.gpa) {
      setResults([
        ...results,
        {
          id: results.length + 1,
          ...newResult,
        },
      ]);
      setNewResult({ courseUnit: '', creditUnit: 0, gpa: 0 });
    }
  };

  const handleDelete = (id: number) => {
    setResults(results.filter((result) => result.id !== id));
  };

  const handleEdit = (result: Result) => {
    setEditingId(result.id);
    setNewResult({
      courseUnit: result.courseUnit,
      creditUnit: result.creditUnit,
      gpa: result.gpa,
    });
  };

  const handleUpdate = () => {
    if (editingId) {
      setResults(
        results.map((result) =>
          result.id === editingId
            ? { ...result, ...newResult }
            : result
        )
      );
      setEditingId(null);
      setNewResult({ courseUnit: '', creditUnit: 0, gpa: 0 });
    }
  };

  return (
    <Container maxWidth="md" sx={{ mt: 4 }}>
      <Paper elevation={3} sx={{ p: 4 }}>
        <Typography variant="h4" gutterBottom>
          Academic Results
        </Typography>

        <Box sx={{ mb: 3, display: 'flex', gap: 2 }}>
          <TextField
            label="Course Unit"
            value={newResult.courseUnit}
            onChange={(e) =>
              setNewResult({ ...newResult, courseUnit: e.target.value })
            }
          />
          <TextField
            label="Credit Unit"
            type="number"
            value={newResult.creditUnit}
            onChange={(e) =>
              setNewResult({ ...newResult, creditUnit: Number(e.target.value) })
            }
          />
          <TextField
            label="GPA"
            type="number"
            value={newResult.gpa}
            onChange={(e) =>
              setNewResult({ ...newResult, gpa: Number(e.target.value) })
            }
          />
          <Button
            variant="contained"
            onClick={editingId ? handleUpdate : handleAdd}
          >
            {editingId ? 'Update' : 'Add'}
          </Button>
        </Box>

        <TableContainer>
          <Table>
            <TableHead>
              <TableRow>
                <TableCell>Course Unit</TableCell>
                <TableCell>Credit Unit</TableCell>
                <TableCell>GPA</TableCell>
                <TableCell>Actions</TableCell>
              </TableRow>
            </TableHead>
            <TableBody>
              {results.map((result) => (
                <TableRow key={result.id}>
                  <TableCell>{result.courseUnit}</TableCell>
                  <TableCell>{result.creditUnit}</TableCell>
                  <TableCell>{result.gpa}</TableCell>
                  <TableCell>
                    <Button
                      startIcon={<EditIcon />}
                      onClick={() => handleEdit(result)}
                    >
                      Edit
                    </Button>
                    <Button
                      startIcon={<DeleteIcon />}
                      onClick={() => handleDelete(result.id)}
                      color="error"
                    >
                      Delete
                    </Button>
                  </TableCell>
                </TableRow>
              ))}
            </TableBody>
          </Table>
        </TableContainer>
      </Paper>
    </Container>
  );
};

export default Results;
